(function() {
  if (window.speechSynthesis == null) {
    alert("Web Speech API is not supported by your browser. Please use at least Chrome ver. 33");
    return;
  }
  
  var Status = Object.freeze({OK: 1, WARNING: 2, CRITICAL:3});
  var ReportType = Object.freeze({NORMALIZED: 0, NOT_LOADED: 1, NULL_VALUE: 2, VALUE: 3});
  var serverConnectionWarning = new Audio("data:audio/mp3;base64,");
    
  function checkSingleStats() {
    if (!checkSingleStats.previousState) {
      checkSingleStats.previousState = {};
    }
    
    var singleStats = document.getElementsByTagName('grafana-panel-singlestat');
    var reports = { critical: [], warning: [], ok: [] };
    for (var i = 0, singleStat; singleStat = singleStats[i]; ++i) {
      var metric = { 
        title: singleStat.querySelector('.panel-title-text').innerText, 
        isLoaded: singleStat.querySelector(".alert-error.panel-error") == null,
        color: singleStat.querySelector('grafana-panel div').style.backgroundColor,
        value: singleStat.querySelector('.singlestat-panel-value').innerText
      };

      var previousMetricStateCaptured = false;
      var metricStateChanged = false;
      if (checkSingleStats.previousState[metric.title] != null) {
        previousMetricStateCaptured = true;
        metricStateChanged = checkSingleStats.previousState[metric.title].metric.value !== metric.value ||
	  checkSingleStats.previousState[metric.title].metric.color !== metric.color;
      }

      if (previousMetricStateCaptured && !metricStateChanged) {
        continue;
      }

      var report = undefined;      
      if (!metric.isLoaded) {
        report = {status: Status.WARNING, type: ReportType.NOT_LOADED, metric: metric};
        reports.warning.push(report);
      } else if (metric.value === "N/A") {
        report = {status: Status.WARNING, type: ReportType.NULL_VALUE, metric: metric};
        reports.warning.push(report);
      } else if (metric.color === "rgba(237, 129, 40, 0.890196)") {
        report = {status: Status.WARNING, type: ReportType.VALUE, metric: metric};
        reports.warning.push(report);
      } else if (metric.color === "rgba(245, 54, 54, 0.901961)") {
        report = {status: Status.CRITICAL, type: ReportType.VALUE, metric: metric};
        reports.critical.push(report);
      } else if (previousMetricStateCaptured && checkSingleStats.previousState[metric.title].status !== Status.OK) {
        report = {status: Status.OK, type: ReportType.NORMALIZED, metric: metric};
        reports.ok.push(report);
      }
      if (report) {
        checkSingleStats.previousState[metric.title] = report;
      }
    }
    
    if (!!reports.critical.length) {
      var criticalMessage = "Danger: " + getLocalizedReportMessage(reports.critical); 
      sayLocalized(criticalMessage);
    }
    if (!!reports.warning.length) {
      var warningMessage = "Warning: " + getLocalizedReportMessage(reports.warning); 
      sayLocalized(warningMessage);
    }
    if (!!reports.ok.length) {
      var okMessage = getLocalizedReportMessage(reports.ok); 
      sayLocalized(okMessage);
    }
  };
  
  
  function getLocalizedReportMessage(reports) {
    var message = ""; 
    for (var i = 0, report; report = reports[i]; ++i) {
      if (report.type === ReportType.VALUE) {
        message += report.metric.title + " value is " + report.metric.value + ", ";
      } else if (report.type === ReportType.NULL_VALUE) {
        message += report.metric.title + " is not available, ";
      } else if (report.type === ReportType.NOT_LOADED) {
        message += "can't load " + report.metric.title + " value, ";
      } else if (report.type === ReportType.NORMALIZED) {
        message += report.metric.title + " value is recovered, "
      }
    }
    return message;
  };
  
  function sayLocalized(message, retryCount) {
    var utterThis = new SpeechSynthesisUtterance(message);
    var voices = window.speechSynthesis.getVoices()
      .filter(function(voice) { return voice.voiceURI === "Google UK English Male";});
    if (voices.length === 0) {
      if (retryCount === undefined) {
        setTimeout(sayLocalized, 5000, message, 2);
      } else if (retryCount > 0) {
        setTimeout(sayLocalized, 5000, message, --retryCount);
      } else {
        console.log("Failed to say message '" + message + "' after 3 retry.");
      }
      return;
    }
    utterThis.voice = voices[0];
    utterThis.onerror = function(event) {
      alert("An error has occurred with the speech synthesis: " + event.error + " Original message: " + message);
    }
    
    if (isOnline()) {
      window.speechSynthesis.speak(utterThis);
    } else {
      serverConnectionWarning.play();  
    }
  };
  
  function isOnline(){
    var xhr = new XMLHttpRequest();
    xhr.open("GET","connectionCheck",false);
    try {
      xhr.send();
      return true;
    } catch (e) {
      return false;
    }
  };
  
  // TODO: Hide only specific link
  var links = document.getElementsByTagName('dash-link')[0];
  if (links != undefined) {
    links.style.display = "none";
  }
  
  window.onbeforeunload = function() {
    return "You have attempted to leave this page. Voice alerting will be disabled.";
  };
  
  sayLocalized("Alerting activated.");
  
  var bootstrap = function () {
    checkSingleStats();
    setTimeout(bootstrap, 1000);
  };
  bootstrap();
})();
